<!DOCTYPE html>
<html xmlns="http://www.thymeleaf.org">
  <head>
    <meta charset="utf-8" />
    <link rel="stylesheet" href="/style.css" />
  </head>
  <body>
    <div class="dashboard">
      <div class="div">
        <div class="nav-bar">
          <div class="navigation">
            <div class="frame">
              <div class="frame-2">
                <div class="text-wrapper">Contact Us</div>
                <div class="text-wrapper">Login</div>
                <div class="text-wrapper">About US</div>
                <div class="text-wrapper">Home</div>
              </div>
              <div class="frame-3">
                <img class="img" src="img/frame-2.svg" />
                <div class="text-wrapper-2">Search for products...</div>
              </div>
              <img class="frame-4" src="img/image.svg" />
              <div class="frame-wrapper"><img class="frame-5" src="img/frame.svg" /></div>
            </div>
          </div>
        </div>
        <footer class="footer">
          <div class="overlap">
            <div class="overlap-group">
              <div class="text-wrapper-3">Company</div>
              <div class="rectangle"></div>
            </div>
            <div class="overlap-group-2">
              <div class="text-wrapper-3">Help</div>
              <div class="rectangle-2"></div>
            </div>
            <div class="text-wrapper-4">About Us</div>
            <div class="text-wrapper-5">Costumer Support</div>
            <div class="text-wrapper-6">Contact Us</div>
            <div class="text-wrapper-7">Shipping</div>
            <div class="text-wrapper-8">Returns</div>
            <div class="text-wrapper-9">Privacy Policy</div>
          </div>
          <div class="text-wrapper-10">FAQ</div>
          <div class="text-wrapper-11">Account</div>
          <div class="text-wrapper-12">Orders</div>
          <div class="text-wrapper-13">Payments</div>
          <div class="social">
            <div class="element"><div class="logo-twitter"></div></div>
            <div class="logo-fb-simple-wrapper"><div class="logo-fb-simple"></div></div>
            <div class="logo-instagram-wrapper"><div class="logo-instagram"></div></div>
            <div class="logo-github-wrapper"><div class="logo-github"></div></div>
          </div>
        </footer>
        <div class="text-wrapper-14">Welcome + Nome</div>
        <div class="overlap-wrapper">
          <div class="overlap-2">
            <div class="rectangle-3"></div>
            <div class="text-wrapper-15">Ordini</div>
          </div>
        </div>
        <div class="overlap-group-wrapper">
          <div class="overlap-3">
            <div class="rectangle-3"></div>
            <div class="text-wrapper-16">Add Product</div>
          </div>
        </div>
        <div class="div-wrapper">
          <div class="overlap-2">
            <div class="rectangle-3"></div>
            <div class="text-wrapper-15">Profilo</div>
          </div>
        </div>
        <div class="frame-6">
          <div class="overlap-4">
            <div class="rectangle-3"></div>
            <div class="text-wrapper-17">Messages</div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
